iterations.yara_rule:
rule Bypass_Sample
{
    meta:
        description = "Evasion bypass rule targeting function call sequences"
        cape_options = "bp0=$pattern0+0,action0=skip,bp1=$pattern1+0,action1=skip,bp2=$pattern2+0,action2=skip,count=0"

    strings:
        $pattern0 = { 8B45 ?? 5A ?? 83C4 ?? 85C0 }
        $pattern1 = { E8CE ?? 6A40 ?? ?? ?? ?? 741F ?? 0x8A }
        $pattern2 = { 0F84 ?? ?? ?? ?? ?? ?? 7407 ?? }

    condition:
        any of them
}

